import { Link } from "react-router-dom";
import { LOGO_URL } from "../utilis/constants";
import React, { useState } from 'react';
import useOnlineStatus from "../utilis/useOnlineStatus";



const Header=()=>{
const onlinestatus=useOnlineStatus();
    const[btname,setbtname]=useState("Login")
    return(
    <div className="flex">
    <div id="img_container" >
        <img src= {LOGO_URL}/>
    </div>
    <div id="nav-item">
    <ul>
    <li id="online">Online Status :{onlinestatus ? <img className="tick" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRRr8dKcFMmV3sXHpjXwoZm64bCdJVykId-cKonx40_IQ&s"/> :<img className="tick" src="SRC\360_F_143112044_gPXDDV55GTU8LQcX9GMbbP2Ss83ORMoy.webp"/>}</li>  
    <li>
    <Link  to="/">  Home</Link>
    </li>
    <li>
    <Link to="/about"> About Us</Link>
    </li>
    <li>
      <Link to="/grocery">Grocery</Link>
    </li>
    <li>
    <Link to="/contact">Contact Us</Link>
    </li>
    <li>Cart</li>
    <button id="login" onClick={()=>{  
     if(btname=="Login")
     {
     setbtname("LogOut")
     }
     else{
     setbtname("Login")
     }
    }}>{btname}</button>
    </ul>
     </div>
    </div>
    );

     };
export  default Header;
